INSERT INTO `club_proposals` (`id`, `user_id`, `club_name`, `field`, `objectives`, `reason`, `planned_activities`, `expected_members`, `advisor_name`, `advisor_email`, `proposer_name`, `proposer_email`, `proposer_student_code`, `member_list_file`, `activity_plan_file`, `status`, `admin_notes`, `reviewed_by`, `reviewed_at`, `created_at`, `updated_at`) VALUES
(1, 2, 'CLB NGƯỜI TỐT VIỆC TỐT', 'HOẠT ĐỘNG', 'tạo các hoạt động cho sinh viên giúp đỡ và rèn luyện các kỹ năng', 'tạo các hoạt động cho sinh viên giúp đỡ và rèn luyện các kỹ năng', 'tạo ra các hoạt động hằng 4 5 hoạt động / tuần', 10, NULL, NULL, 'Admin', 'admin@clb.dev', 'admin', 'club-proposals/PM8fvWn5jCd6qdEFF7hnnNSSpRsjGd6cbLWNWJi6.xlsx', 'club-proposals/RoIZ3M65igcg6jjetN9WKXaDpF1ubapcPkVsZYUK.doc', 'rejected', 'ab', 2, '2025-12-12 09:03:48', '2025-12-12 09:02:03', '2025-12-12 09:03:48'),
(2, 13, 'CLB NGƯỜI TỐT VIỆC TỐT', 'Hoạt Động', 'CLB Người Tốt Việc Tốt hướng đến việc lan tỏa tinh thần tử tế, kết nối những người có chung mong muốn làm điều tốt và tổ chức các hoạt động thiện nguyện ý nghĩa, góp phần xây dựng một cộng đồng nhân ái và tích cực hơn.', 'CLB Người Tốt Việc Tốt cần được thành lập để tạo môi trường gắn kết những bạn trẻ có tinh thần thiện nguyện, thúc đẩy các hoạt động hỗ trợ cộng đồng và lan tỏa những hành động đẹp, góp phần xây dựng một tập thể nhân ái, đoàn kết và trách nhiệm hơn.', 'CLB dự kiến tổ chức các hoạt động thiện nguyện như thăm và hỗ trợ người khó khăn, thực hiện các chương trình bảo vệ môi trường, quyên góp sách vở – quần áo, cùng những chiến dịch lan tỏa thông điệp sống đẹp nhằm tạo ảnh hưởng tích cực đến cộng đồng.', 10, NULL, NULL, 'Nguyễn Thị Mè', '110122221@st.tvu.edu.vn', '110122221', 'club-proposals/3i6MAcW5bEPPql5iFavtrO5JzSEsynyrhUUgJyRp.xlsx', 'club-proposals/cIjDy6eA5Ybcbyy09YDfWTveVMd0pgtiHJvh9rip.docx', 'approved', 'abc', 2, '2025-12-12 09:07:14', '2025-12-12 09:06:01', '2025-12-12 09:07:14');
