(2, 'Về Nguồn', NULL, 53, 359, 'Về Nguồn là hoạt động ý nghĩa nhằm tri ân truyền thống, tưởng nhớ công lao của các thế hệ đi trước và giáo dục tinh thần yêu nước cho thế hệ trẻ.', NULL, '2025-12-23 17:30:00', '2025-12-23 20:00:00', 'Đền Thờ Bác Long Đức', NULL, NULL, NULL, 'upcoming', 'pending', NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-11 13:30:28', '2025-12-19 12:37:26', NULL, NULL),
(4, 'Tập Nhảy Đại Hôi', NULL, 53, 341, 'Tập Nhảy Đại Hội là hoạt động luyện tập đồng diễn, góp phần tạo không khí sôi nổi và chuẩn bị cho chương trình Đại hội diễn ra thành công.', NULL, '2025-12-28 02:00:00', '2025-12-31 04:00:00', 'Khu Sản A1', NULL, NULL, NULL, 'upcoming', 'approved', NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-15 11:15:34', '2025-12-19 12:37:26', NULL, NULL),
(5, 'Tập Múa và Nhảy cho Trung Thu', 'arts', 53, 15, 'Tập Múa và Nhảy Trung Thu: Chương trình luyện tập các bài múa, nhảy vui tươi theo nhạc Trung Thu, giúp các em rèn luyện sự dẻo dai, tự tin và tinh thần tập thể, chuẩn bị cho đêm hội trăng rằm.', 'Phục vụ Văn Nghệ Cho Lễ Hội', '2026-01-15 00:00:00', '2026-10-01 12:00:00', 'Tập Nhảy Ở Sảnh B7 Hoặc Chổ Trống Trong Trường', 20, 500000.00, 'event_attachments/1765832018_danh_sach_hoat_dong_2025-12-15.pdf', 'upcoming', 'approved', NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-15 13:53:38', '2025-12-19 12:37:26', NULL, NULL),
(7, 'Workshop Guitar Cơ Bản', 'academic', 53, 15, 'Giới thiệu cấu tạo đàn guitar\r\n\r\nHọc hợp âm cơ bản (C, G, Am, F…)\r\n\r\nThực hành đệm hát bài đơn giản\r\nGiao lưu hỏi đáp với thành viên có kinh nghiệm', 'Giúp tân thành viên nắm được các kiến thức cơ bản về guitar (hợp âm, nhịp điệu, kỹ thuật tay).', '2025-12-22 18:00:00', '2025-12-22 20:30:00', 'Phòng sinh hoạt CLB Âm Nhạc', 25, 300000.00, 'event_attachments/1765867034_THONG BAO DANG KY MON HOC, HOC KY 2 NAM HOC 2025- 2026.pdf', 'finished', 'approved', NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-15 23:37:15', '2025-12-19 12:37:26', NULL, NULL),
