(1, 'Đăng ký hoạt động được duyệt', 'Đơn đăng ký tham gia hoạt động \'Nhảy Chào Mừng Tân Sinh Viên\' của bạn đã được duyệt.', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-15 10:40:34', '2025-12-15 10:40:34'),
(2, 'Đăng ký hoạt động bị từ chối', 'Đơn đăng ký tham gia hoạt động \'Về Nguồn\' của bạn đã bị từ chối. Lý do: Không có lý do', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-15 11:09:00', '2025-12-15 11:09:00'),
(3, 'Đăng ký hoạt động bị từ chối', 'Đơn đăng ký tham gia hoạt động \'Tập Nhảy Đại Hôi\' của bạn đã bị từ chối. Lý do: Đủ số lượng tham gia', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-15 11:29:33', '2025-12-15 11:29:33'),
(4, 'Đề xuất hoạt động được duyệt', 'Đề xuất hoạt động \'Tập Múa và Nhảy cho Trung Thu\' của bạn đã được duyệt bởi Chủ nhiệm.', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-15 13:56:00', '2025-12-15 13:56:00'),
(5, 'Đề xuất hoạt động bị từ chối', 'Đề xuất hoạt động \'Tham Gia Chào Mừng Tân Sinh Viên\' của bạn đã bị từ chối. Lý do: Thiếu thông tin chi tiết', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-15 23:42:55', '2025-12-15 23:42:55'),
(6, 'Đăng ký hoạt động được duyệt', 'Đơn đăng ký tham gia hoạt động \'Tập Múa và Nhảy cho Trung Thu\' của bạn đã được duyệt.', 'system', 'all', NULL, NULL, NULL, 'draft', 13, 'admin', NULL, 0, '2025-12-16 01:21:22', '2025-12-16 01:21:22'),
(7, 'Bảo Trì Website', 'thông báo bảo trì update thêm các chức năng cho sinh viên', 'system', 'all', NULL, '2025-12-23 01:31:53', NULL, 'sent', 2, 'admin', NULL, 1, '2025-12-23 01:31:53', '2025-12-23 01:31:53'),
(8, 'Thông báo cập nhật hệ thống quản lý câu lạc bộ', 'Ban Quản trị thông báo hệ thống quản lý câu lạc bộ đã được cập nhật các chức năng mới nhằm nâng cao trải nghiệm người dùng. Sinh viên vui lòng đăng nhập và kiểm tra thông tin cá nhân để đảm bảo dữ liệu chính xác.', 'system', 'all', NULL, '2025-12-03 01:43:19', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:19', '2025-12-23 01:43:19'),
(9, 'Yêu cầu hoàn tất xác thực tài khoản', 'Sinh viên vui lòng hoàn tất xác thực email để đảm bảo đầy đủ quyền truy cập vào các chức năng của hệ thống. Các tài khoản chưa xác thực có thể bị hạn chế một số quyền sử dụng.', 'system', 'students', NULL, '2025-12-04 01:43:19', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:19', '2025-12-23 01:43:19'),
(10, 'Mở đăng ký tham gia câu lạc bộ học kỳ mới', 'Nhà trường chính thức mở cổng đăng ký tham gia các câu lạc bộ sinh viên trong học kỳ mới. Sinh viên truy cập hệ thống, chọn câu lạc bộ phù hợp và gửi yêu cầu tham gia trước thời hạn quy định.', 'administrative', 'students', NULL, '2025-12-05 01:43:19', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:19', '2025-12-23 01:43:19'),
(11, 'Nhắc nhở hạn cuối đăng ký CLB', 'Thời hạn đăng ký tham gia câu lạc bộ sẽ kết thúc trong thời gian sắp tới. Sinh viên chưa đăng ký vui lòng hoàn tất thủ tục trước khi hệ thống đóng cổng đăng ký.', 'administrative', 'students', NULL, '2025-12-06 01:43:19', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:19', '2025-12-23 01:43:19'),
(12, 'Ban hành nội quy chung dành cho sinh viên tham gia CLB', 'Ban Quản trị ban hành nội quy chung áp dụng cho tất cả sinh viên tham gia câu lạc bộ. Sinh viên có trách nhiệm đọc, hiểu và tuân thủ đầy đủ các quy định đã được công bố trên hệ thống.', 'regulation', 'all', NULL, '2025-12-07 01:43:20', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:20', '2025-12-23 01:43:20'),
(13, 'Cập nhật nội quy câu lạc bộ', 'Một số nội dung trong nội quy câu lạc bộ đã được điều chỉnh nhằm phù hợp với tình hình thực tế. Sinh viên vui lòng truy cập mục Nội quy – Vi phạm để xem chi tiết.', 'regulation', 'all', NULL, '2025-12-08 01:43:20', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:20', '2025-12-23 01:43:20'),
(14, 'Cập nhật điểm hoạt động sinh viên', 'Hệ thống đã cập nhật điểm hoạt động cá nhân dựa trên các hoạt động sinh viên đã tham gia. Sinh viên kiểm tra và phản hồi nếu phát hiện sai sót.', 'system', 'students', NULL, '2025-12-09 01:43:20', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:20', '2025-12-23 01:43:20'),
(15, 'Thông báo bắt đầu học kỳ mới', 'Nhà trường chính thức bắt đầu học kỳ mới. Các câu lạc bộ sẽ triển khai kế hoạch hoạt động theo lịch đã đăng ký. Sinh viên theo dõi thông báo để không bỏ lỡ thông tin quan trọng.', 'administrative', 'all', NULL, '2025-12-10 01:43:20', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:20', '2025-12-23 01:43:20'),
(16, 'Tham gia hoạt động phong trào cấp trường', 'Nhà trường tổ chức hoạt động phong trào cấp trường dành cho sinh viên. Các câu lạc bộ và thành viên quan tâm vui lòng theo dõi thông tin chi tiết tại mục Hoạt động.', 'administrative', 'all', NULL, '2025-12-11 01:43:21', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:21', '2025-12-23 01:43:21'),
(17, 'Thông báo bảo trì hệ thống', 'Hệ thống sẽ tạm ngưng hoạt động trong thời gian bảo trì theo kế hoạch. Sinh viên chủ động sắp xếp thời gian sử dụng và theo dõi thông báo khi hệ thống hoạt động trở lại.', 'system', 'all', NULL, '2025-12-12 01:43:21', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:21', '2025-12-23 01:43:21'),
(18, 'Yêu cầu cập nhật thông tin cá nhân', 'Sinh viên vui lòng kiểm tra và cập nhật đầy đủ thông tin cá nhân trên hệ thống để đảm bảo dữ liệu chính xác phục vụ cho công tác quản lý.', 'administrative', 'students', NULL, '2025-12-13 01:43:21', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:21', '2025-12-23 01:43:21'),
(19, 'Nhắc nhở sử dụng hệ thống đúng quy định', 'Hệ thống quản lý câu lạc bộ chỉ được sử dụng cho các mục đích học tập và hoạt động phong trào. Mọi hành vi sử dụng sai mục đích sẽ bị xử lý theo quy định.', 'regulation', 'all', NULL, '2025-12-14 01:43:21', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:21', '2025-12-23 01:43:21'),
(20, 'Quyền và nghĩa vụ của sinh viên khi tham gia CLB', 'Sinh viên khi tham gia câu lạc bộ có quyền và nghĩa vụ theo quy định của nhà trường. Vui lòng tham khảo chi tiết tại mục Nội quy – Vi phạm.', 'regulation', 'students', NULL, '2025-12-15 01:43:21', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:21', '2025-12-23 01:43:21'),
(21, 'Thông báo về việc xử lý vi phạm nội quy', 'Ban Quản trị đã tiến hành xử lý một số trường hợp vi phạm nội quy câu lạc bộ. Sinh viên cần nghiêm túc chấp hành để tránh các hình thức kỷ luật không mong muốn.', 'regulation', 'all', NULL, '2025-12-16 01:43:22', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:22', '2025-12-23 01:43:22'),
(22, 'Khảo sát ý kiến sinh viên về hoạt động CLB', 'Nhà trường tổ chức khảo sát nhằm thu thập ý kiến sinh viên về chất lượng hoạt động câu lạc bộ. Sinh viên vui lòng tham gia khảo sát để góp phần cải thiện hệ thống.', 'administrative', 'students', NULL, '2025-12-17 01:43:22', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:22', '2025-12-23 01:43:22'),
(23, 'Thông báo tổng kết hoạt động CLB', 'Cuối học kỳ, nhà trường sẽ tiến hành tổng kết hoạt động các câu lạc bộ. Sinh viên theo dõi thông báo từ CLB để nắm rõ thời gian và nội dung tổng kết.', 'administrative', 'all', NULL, '2025-12-18 01:43:22', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:22', '2025-12-23 01:43:22'),
(24, 'Thông báo thay đổi nhân sự quản lý CLB', 'Một số câu lạc bộ có sự thay đổi về nhân sự quản lý. Sinh viên vui lòng cập nhật thông tin mới để thuận tiện trong quá trình sinh hoạt CLB.', 'administrative', 'all', NULL, '2025-12-19 01:43:23', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:23', '2025-12-23 01:43:23'),
(25, 'Hướng dẫn sử dụng hệ thống quản lý CLB', 'Sinh viên mới tham gia hệ thống vui lòng tham khảo tài liệu hướng dẫn sử dụng để nắm rõ các chức năng và thao tác cơ bản.', 'system', 'students', NULL, '2025-12-20 01:43:23', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:23', '2025-12-23 01:43:23'),
(26, 'Thông báo kết thúc năm học', 'Năm học đã kết thúc. Nhà trường ghi nhận sự tham gia tích cực của sinh viên trong các hoạt động câu lạc bộ và mong tiếp tục nhận được sự đồng hành trong năm học tới.', 'administrative', 'all', NULL, '2025-12-21 01:43:23', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:23', '2025-12-23 01:43:23'),
(27, 'Thông báo chung cuối học kỳ', 'Ban Quản trị cảm ơn sinh viên đã tích cực tham gia các hoạt động câu lạc bộ trong suốt học kỳ vừa qua. Chúc sinh viên có kỳ nghỉ an toàn và hiệu quả.', 'administrative', 'all', NULL, '2025-12-22 01:43:23', NULL, 'sent', 1, 'admin', NULL, 1, '2025-12-23 01:43:23', '2025-12-23 01:43:23'),
(31, 'Yêu cầu hỗ trợ mới: vấn đề đăng ký tham gia clb', 'Sinh viên Nguyễn Thị Mè (110122221) đã gửi yêu cầu hỗ trợ: tôi cần hỗ trợ hướng dẫn chi tiết', 'administrative', 'all', NULL, '2026-01-04 10:04:03', NULL, 'sent', 13, 'support', NULL, 0, '2026-01-04 10:04:03', '2026-01-04 10:04:03'),
(35, 'Yêu cầu hỗ trợ mới: Tôi cần hỗ trợ', 'Sinh viên Nguyễn Thị Mè (110122221) đã gửi yêu cầu hỗ trợ: tôi cần hỗ trợ đăng ký tham gia clb', 'administrative', 'all', NULL, '2026-01-04 10:28:55', NULL, 'sent', 13, 'support', NULL, 0, '2026-01-04 10:28:55', '2026-01-04 10:28:55'),
(36, 'Phản hồi yêu cầu hỗ trợ', 'Yêu cầu hỗ trợ của bạn đã được phản hồi: Tôi cần hỗ trợ', 'administrative', 'students', NULL, '2026-01-04 10:29:28', NULL, 'sent', 2, 'admin', NULL, 0, '2026-01-04 10:29:28', '2026-01-04 10:29:28');
