INSERT INTO `support_requests` (`id`, `user_id`, `club_id`, `sender_type`, `name`, `email`, `student_code`, `subject`, `content`, `status`, `priority`, `admin_response`, `responded_by`, `responded_at`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, 'guest', 'Trần Minh Luân', 'luannguyennldh@gmail.com', NULL, 'Tôi cần hỗ trợ', 'hỗ trợ tui tạo tài khoản tui tạo tài khoản không được', 'closed', 'medium', 'tôi sẽ hỗ trợ ban sóm nhất', 2, '2025-12-24 00:02:52', '2025-12-24 00:01:00', '2025-12-24 00:02:52'),
(2, 13, NULL, 'student', NULL, NULL, '110122221', 'Vấn đề về đăng ký câu lạc bộ', 'tôi muống hỗ trợ tôi dăng ký câu lạc bộ', 'closed', 'medium', '🎯 HƯỚNG DẪN ĐĂNG KÝ THAM GIA CÂU LẠC BỘ\r\n👤 Đối tượng\r\n\r\nSinh viên Trường Đại học Trà Vinh\r\n\r\nĐã có tài khoản sinh viên trên hệ thống\r\n\r\n🔐 Bước 1: Đăng nhập hệ thống\r\n\r\nTruy cập website Hệ thống Quản lý Câu lạc bộ TVU\r\n\r\nNhấn nút Đăng nhập\r\n\r\nNhập:\r\n\r\nEmail sinh viên / Mã số sinh viên\r\n\r\nMật khẩu\r\n\r\nNhấn Đăng nhập\r\n\r\n📌 Nếu chưa có tài khoản → chọn Đăng ký tài khoản và điền đầy đủ thông tin cá nhân.\r\n\r\n🔍 Bước 2: Xem danh sách Câu lạc bộ\r\n\r\nTại trang chủ, chọn menu Câu lạc bộ\r\n\r\nHệ thống hiển thị danh sách các CLB hiện có:\r\n\r\nCLB Học thuật\r\n\r\nCLB Văn hóa – Nghệ thuật\r\n\r\nCLB Thể thao\r\n\r\nCLB Tình nguyện – Kỹ năng\r\n\r\nCó thể:\r\n\r\nTìm kiếm theo tên CLB\r\n\r\nLọc theo lĩnh vực hoạt động\r\n\r\n📄 Bước 3: Xem chi tiết Câu lạc bộ\r\n\r\nNhấn vào Tên CLB bạn quan tâm\r\n\r\nXem thông tin chi tiết:\r\n\r\nGiới thiệu CLB\r\n\r\nMục tiêu – hoạt động\r\n\r\nBan chủ nhiệm\r\n\r\nĐiều kiện tham gia\r\n\r\nLịch sinh hoạt\r\n\r\n📝 Bước 4: Đăng ký tham gia Câu lạc bộ\r\n\r\nNhấn nút Đăng ký tham gia\r\n\r\nĐiền form đăng ký (nếu có):\r\n\r\nLý do tham gia\r\n\r\nKỹ năng / sở thích\r\n\r\nKinh nghiệm (không bắt buộc)\r\n\r\nNhấn Gửi đăng ký\r\n\r\n✅ Hệ thống sẽ thông báo:\r\n\r\n“Đăng ký thành công – vui lòng chờ xét duyệt”\r\n\r\n⏳ Bước 5: Chờ xét duyệt từ Ban chủ nhiệm\r\n\r\nTrạng thái đăng ký:\r\n\r\n⏳ Chờ duyệt\r\n\r\n✅ Đã chấp nhận\r\n\r\n❌ Bị từ chối\r\n\r\nSinh viên sẽ nhận:\r\n\r\nThông báo trên hệ thống\r\n\r\nHoặc email (nếu hệ thống có cấu hình)\r\n\r\n🎉 Bước 6: Tham gia hoạt động CLB\r\n\r\nKhi được duyệt:\r\n\r\nBạn trở thành Thành viên CLB\r\n\r\nCó thể:\r\n\r\nXem sự kiện CLB\r\n\r\nĐăng ký tham gia hoạt động\r\n\r\nNhận thông báo & tài liệu\r\n\r\nĐiểm danh, đánh giá hoạt động', 2, '2025-12-24 00:30:35', '2025-12-24 00:05:30', '2025-12-24 00:30:35'),
(3, 13, 53, 'chairman', NULL, NULL, '110122221', 'Bị lỗi không duyệt được người tham gia clb', 'Admin hỗ trợ xử lý dùm', 'open', 'high', NULL, NULL, NULL, '2025-12-24 00:47:30', '2025-12-24 00:47:30'),
(4, 13, NULL, 'student', NULL, NULL, '110122221', 'Thắc mắc về điểm hoạt động', 'tôi chưa hiểu cách tính điểm của các hoạt động', 'open', 'medium', NULL, NULL, NULL, '2026-01-04 09:55:00', '2026-01-04 09:55:00'),
(5, 13, NULL, 'student', NULL, NULL, '110122221', 'vấn đề đăng ký tham gia clb', 'tôi cần hỗ trợ hướng dẫn chi tiết', 'open', 'medium', NULL, NULL, NULL, '2026-01-04 10:01:37', '2026-01-04 10:01:37'),
(6, 13, NULL, 'student', NULL, NULL, '110122221', 'vấn đề đăng ký tham gia clb', 'tôi cần hỗ trợ hướng dẫn chi tiết', 'open', 'medium', '🔹 Bước 1: Sinh viên xem danh sách CLB\r\n\r\nCLB còn hoạt động\r\n\r\nHiển thị: tên CLB, mô tả, số lượng thành viên, trạng thái\r\n\r\n🔹 Bước 2: Sinh viên gửi yêu cầu đăng ký\r\n\r\nClick “Đăng ký tham gia”\r\n\r\nNhập:\r\n\r\nLý do tham gia\r\n\r\nKỹ năng (nếu có)\r\n\r\nHệ thống kiểm tra:\r\n\r\nĐã tham gia CLB này chưa?\r\n\r\nCLB có cho phép đăng ký không?\r\n\r\n🔹 Bước 3: Hệ thống lưu đơn đăng ký\r\n\r\nTrạng thái ban đầu: pending (chờ duyệt)\r\n\r\n🔹 Bước 4: Chủ nhiệm CLB xét duyệt\r\n\r\nChấp nhận → thêm sinh viên vào CLB\r\n\r\nTừ chối → ghi lý do\r\n\r\n🔹 Bước 5: Sinh viên nhận kết quả\r\n\r\nThông báo kết quả đăng ký', 2, '2026-01-04 10:16:49', '2026-01-04 10:04:03', '2026-01-04 10:16:49'),
(7, 13, NULL, 'student', NULL, NULL, '110122221', 'Tôi cần hỗ trợ', 'tôi cần hỗ trợ đăng ký tham gia clb', 'open', 'medium', 'tôi sẽ hỗ trợ bạn', 2, '2026-01-04 10:29:28', '2026-01-04 10:28:55', '2026-01-04 10:29:28');
