(6, 'website_description', 'website', 'Website Câu lạc bộ Trường Đại học Trà Vinh là hệ thống trực tuyến hỗ trợ giới thiệu, quản lý và kết nối các câu lạc bộ sinh viên trong toàn trường. Website cung cấp thông tin đầy đủ về các câu lạc bộ, hoạt động, sự kiện và thông báo, giúp sinh viên dễ dàng tìm hiểu và đăng ký tham gia theo sở thích. Đồng thời, hệ thống hỗ trợ ban quản lý và chủ nhiệm câu lạc bộ quản lý thành viên, tổ chức hoạt động và theo dõi quá trình tham gia của sinh viên một cách hiệu quả, góp phần nâng cao chất lượng phong trào và đời sống sinh viên trong nhà trường.', 'string', NULL, '2025-12-23 17:40:57', '2025-12-23 23:03:36'),
