(3, 'Nguyễn Văn A', '110122111@st.tvu.edu.vn', '110122111', '0361173318', 'female', '1999-07-09', 'Khoa Công nghệ Thông tin - Mạng máy tính và truyền thông dữ liệu', 'DA22MTC', 'Xin chào! Tôi là Nguyễn Văn A, sinh viên Đại học Trà Vinh, chuyên ngành Mạng máy tính và truyền thông dữ liệu. Tôi thích tham gia các hoạt động ngoại khóa và tình nguyện.', NULL, 0, NULL, 1, 1, 1, 'vi', 0, 2, 1, NULL, NULL, '$2y$12$/xubntw3dm/1od.jzSDV6..VPLH8/8sK/UTMFGfGvUGodeZgylSFi', NULL, '2025-12-01 17:29:12', '2025-12-20 10:14:50'),
(4, 'Nguyễn Văn B', '110122100@st.tvu.edu.vn', '110122100', '0762550697', 'male', '2004-12-13', 'Khoa Nông nghiệp - Thủy sản - Thú y', 'DA22TYC', 'Xin chào! Tôi là Nguyễn Văn B, sinh viên ngành Thú y khóa 2022 tại Đại học Trà Vinh. Tôi đam mê học hỏi và phát triển bản thân.', 'avatars/uYygu1oNNYZT3Iy3Mrmbkkj3uPVc7tWVb3V94llF.png', 0, NULL, 1, 1, 1, 'vi', 0, 2, 1, '2025-12-17 05:07:56', NULL, '$2y$12$oJrVXEWLAP9/CpvyV7wQ2Op5WqqSPPAKw7JguUDLDybfWoBF5gxX2', NULL, '2025-12-01 17:30:37', '2025-12-20 10:14:50'),
(5, 'Nguyễn Minh Khang', '110122102@st.tvu.edu.vn', '110122102', '0914896785', 'female', '2003-04-03', 'Khoa Công nghệ Thông tin - Trí tuệ nhân tạo', 'DA22AIC', 'Chào mọi người! Mình là Nguyễn Minh Khang, hiện đang là sinh viên năm 2 ngành Trí tuệ nhân tạo. Rất vui được làm quen!', NULL, 0, NULL, 1, 1, 1, 'vi', 0, 2, 1, NULL, NULL, '$2y$12$YoBZBjanwR599DDlmYoqu.OkNEbKWN.vaSlflaQxOjNtfxuQutfci', NULL, '2025-12-01 18:03:13', '2025-12-20 10:14:50'),
(6, 'Nguyễn Văn d', '110122103@st.tvu.edu.vn', '110122103', '0813917197', 'male', '2002-02-15', 'Khoa Công nghệ Thông tin - Mạng máy tính và truyền thông dữ liệu', 'DA22MTC', 'Chào các bạn! Mình là Nguyễn Văn d, sinh viên khóa 2022 ngành Mạng máy tính và truyền thông dữ liệu. Mình rất thích tham gia các CLB và hoạt động của trường.', NULL, 0, NULL, 1, 1, 1, 'vi', 0, 2, 1, NULL, NULL, '$2y$12$qYUu/nK0zzryhfHsqRBoo.Umh1750NQP4WRn2B62OgqE9VVS//w4i', NULL, '2025-12-01 18:28:42', '2025-12-20 10:14:50'),
(8, 'Nguyễn Thị Lua', '110122112@st.tvu.edu.vn', '110122112', '0334998582', 'female', '1999-05-21', 'Khoa Công nghệ Thông tin - Hệ thống thông tin quản lý', 'DA22HTC', 'Chào các bạn! Mình là Nguyễn Thị Lua, sinh viên khóa 2022 ngành Hệ thống thông tin quản lý. Mình rất thích tham gia các CLB và hoạt động của trường.', NULL, 0, NULL, 1, 1, 1, 'vi', 0, 2, 1, NULL, NULL, '$2y$12$k8ne7oQj6VkSWPAiCHOOu.MUpIyaaLH0BDiY42ws9zQLuvzCkf.ei', NULL, '2025-12-04 10:16:31', '2025-12-20 10:14:50'),
